Sepedophilus constans adolah kumbang dari famili Staphylinidae. Spesies ko juo marupokan bagian dari ordo Coleoptera, kelas Insecta, filum Arthropoda, dan kingdom Animalia.
Kumbang iko biasonyo punyo elitra nan pendek.
